    pageContent: {
        margin: theme.spacing(5),
        padding: theme.spacing(3)
    }
})) 


export default function AccountPage() {
    const classes = useStyle()
    return (
        <div className={classes.pageContent}>
            <AccountPageForm/>
        </div>
    )
}
